import React from "react";

const Header = (props) => {
  return (
    <header>
      <img src="https://www.nasa.gov/sites/all/themes/custom/nasatwo/images/nasa-logo.svg" />
      <h1>NASA</h1>
    </header>
  );
};
export default Header;
